mdatas = {}
for d in datas:
    mdatas[d['id']] = d

xz = {}

# 乡镇厂
for d in datas:
    if d['deptName'][-1] in '乡镇厂':
        name = d['deptName'].replace('德安县', '')
        xz[name] = []
    pass

for d in datas:
    pid = d['parentId']
    if pid not in mdatas:
        continue
    p = mdatas[pid]
    if p['deptName'][-1] not in ('乡', '镇', '厂'):
        continue
    cun = {'cunName': d['deptName'], 'xzName': p['deptName'].replace('德安县', '')}
    cuns.append(cun)

cuns.sort(key = lambda x: x['xzName'].encode('gbk'))

